import React, { useState } from "react";
import { View, Text, StyleSheet, StatusBar, SafeAreaView, ImageBackground, TextInput, } from "react-native";
import { ScrollView } from "react-native-gesture-handler";
import { Ionicons } from "react-native-vector-icons";
import { useNavigation } from '@react-navigation/native';

import ListaDeUsuarios from "../ListaDeUsuarios/ListaDeUsuarios";
import styles from './estilo';
import styleGeral from '../estiloGeral/style'

export default function tPesquisa() {

    const [text, setText] = useState("");

    const navigation = useNavigation();
    function Voltar() {
        navigation.goBack()
    }

    return (
        <ImageBackground style={styleGeral.container}>
            <SafeAreaView style={styles.view}>
                <View style={styles.cabecalho}>
                    <Ionicons
                        name="chevron-back"
                        size={40}
                        color="black"
                        onPress={Voltar}    
                    />
                    <TextInput
                        style={styles.input}
                        placeholder="Pesquisar"
                        autoCapitalize="none"
                        autoCorrect={false}
                        value={text}
                        onChangeText={(value) => setText(value)}
                    />
                    <Ionicons
                        name="search"
                        size={40}
                        color="black"
                        onPress={() => { }}
                    />
                </View>
            </SafeAreaView>

            <ScrollView>
                <View style={styles.container}>
                    <ListaDeUsuarios/>
                </View>
            </ScrollView>

        </ImageBackground>
    );
}
